        "id": 0,
        "question": "Кому слуги дали спробувати чудесне вино?",
        "answer": "Весільному старості",
        "subAnswer": "І Він каже до них: Тепер зачерпніть, і занесіть до весільного старости. І занесли (Івана 2:8)"
